import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input by its ID and fill it with 'iPhone'
    const searchInputSelector = '#searchInput';
    await page.waitForSelector(searchInputSelector, { timeout: 5000 });
    await page.fill(searchInputSelector, 'iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate the first search button by its class and click it
    const searchButtonSelector = '.search-btn';
    await page.waitForSelector(searchButtonSelector, { timeout: 5000 });
    await page.locator(searchButtonSelector).first().click();

    // 3. Wait for the search results header to appear
    const resultsHeaderSelector = 'h2:has-text("Search Results for \\"iPhone\\"")';
    await page.waitForSelector(resultsHeaderSelector, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract data to verify the search
    const resultsCountSelector = '.results-count';
    const resultsCountText = await page.textContent(resultsCountSelector);

    return {
      success: true,
      action: "Searched for 'iPhone' and verified search results page.",
      extractedData: {
        searchTerm: 'iPhone',
        resultsCount: resultsCountText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
